  false,\n\t\"url\": null,\n\t\"notes\": \"This report contains quarterly narrative
  reports for Sullys Hill Game Preserve for February 1941 - January 1942. This reports
  summarizes activities and accomplishments including weather and water conditions.
  The wildlife section covers waterbirds, upland birds, and big-game animals. Refuge
  development and maintenance covers physical development. Public relations includes
  recreational uses. Economic uses includes timber removal, timber removal. Photographs
  and items and interest are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
